description:
Most boys in their teen have their own particular friends, and too often that friend is a deciding factor in how the boy's character will develop! Kids in the poorer neighborhoods look around and often see the older hoodlums as shining knights instead of what they really are! The Police Athletic League was organized for kids like these! Sam Barton, rookie cop, was introduced to the PAL in a way that brought the lesson home to him hard! The Hero Worshipper!


